import React, { useState } from 'react'
import "./ImageApi.css"
import axios from 'axios'
function ImageApi() {
    const [images, setImages]=useState([])
    const getImages = ()=> { 
        const res = axios.get('https://picsum.photos/seed/picsum/200/300')
        setImages(res)
    }
  return (
    <div>
      <button className='btn' onClick={getImages}>Get Images</button>
      <div></div>
    </div>
    
  )
}

export default ImageApi
